g.ns1:text:
\begin{itemize}
	\item \xe5\xbf\x9c\xe5\x8a\x9b\xe3\x81\xae\xe3\x81\xaa\xe3\x81\x84\xe5\xa0\xb4\xe5\x90\x88
		{\footnotesize
		\begin{align*}
		R_0 = R_f = R_r = \alpha \exp \left( - \dfrac{\Delta G}{k_BT} \right)
		\end{align*}
		}
	\item \xe5\xbf\x9c\xe5\x8a\x9b\xe3\x82\x92\xe5\x8d\xb0\xe5\x8a\xa0\xe3\x81\x97\xe3\x81\x9f\xe5\xa0\xb4\xe5\x90\x88
		{\footnotesize
		\begin{align*}
		\begin{cases}
		\text{\xe5\xbf\x9c\xe5\x8a\x9b\xe5\x8d\xb0\xe5\x8a\xa0\xe6\x96\xb9\xe5\x90\x91} \\
		R_f = \alpha \exp \left( - \dfrac{\Delta G - \sigma_s v^*}{k_BT} \right)\\
		\text{\xe9\x80\x86\xe6\x96\xb9\xe5\x90\x91} \\
		R_r = \alpha \exp \left( - \dfrac{\Delta G + \sigma_s v^*}{k_BT} \right)
		\end{cases}
		\end{align*}
		}
	\end{itemize}

\xe4\xb8\x80\xe6\x96\xb9\xe3\x80\x81\xe5\x8d\xb0\xe5\x8a\xa0\xe5\xbf\x9c\xe5\x8a\x9b\xe3\x81\x8c\xe5\xa4\xa7\xe3\x81\x8d\xe3\x81\x84\xe3\x80\x81\xe3\x81\x82\xe3\x82\x8b\xe3\x81\x84\xe3\x81\xaf\xe3\x80\x81\xe7\xa7\xbb\xe5\x8b\x95\xe3\x81\x99\xe3\x82\x8b\xe7\xb2\x92\xe5\xad\x90\xe3\x81\x8c\xe5\xa4\xa7\xe3\x81\x8d\xe3\x81\x8f\xe3\x81\xa6\xe3\x80\x81\xe3\x81\x9d\xe3\x81\xae\xe7\xa9\x8d\xe3\x81\xa7\xe3\x81\x82\xe3\x82\x8b $\dfrac{\sigma_s v^*}{k_BT} \gg 1$ \xe3\x81\xae\xe5\xa0\xb4\xe5\x90\x88\xe3\x81\xaf\xe3\x80\x81
\begin{align*}
R \simeq 2 R_0 \exp \left( \dfrac{ \sigma_s v^*}{k_BT} \right)
\end{align*}
\xe3\x81\xa8\xe3\x81\xaa\xe3\x82\x8a\xe3\x80\x81\xe5\xbf\x9c\xe5\x8a\x9b\xe3\x81\xab\xe4\xbe\x9d\xe5\xad\x98\xe3\x81\x97\xe3\x81\x9f\xe9\x9d\x9e\xe7\xb7\x9a\xe5\xbd\xa2\xe6\x80\xa7\xe3\x81\x8c\xe7\x94\x9f\xe3\x81\x98\xe3\x82\x8b\xe3\x80\x82

\xe3\x81\x93\xe3\x81\xae\xe3\x81\xa8\xe3\x81\x8d\xe3\x80\x81\xe5\x89\x8d\xe8\xbf\xb0\xe3\x81\xae\xe7\xa7\xbb\xe5\x8b\x95\xe9\x80\x9f\xe5\xba\xa6 $R$ \xe3\x82\x92\xe3\x80\x81\xe5\xbc\x95\xe3\x81\xa3\xe5\xbc\xb5\xe3\x82\x8a\xe5\xa4\x89\xe5\xbd\xa2\xe9\x80\x9f\xe5\xba\xa6 $\dot{\epsilon}$ \xe3\x81\xa8\xe3\x81\xbf\xe3\x81\xaa\xe3\x81\x97\xe3\x80\x81 $\dot{\epsilon}_0$ \xe3\x82\x92\xe5\xae\x9a\xe6\x95\xb0\xe3\x81\xa8\xe3\x81\x97\xe3\x81\xa6\xe3\x80\x81
\begin{align*}
	\dot{\epsilon} 
	&= \dot{\epsilon}_0 \exp \left( - \dfrac{\Delta G}{RT} \right) 
		\exp \left( \dfrac{ \sigma_s v^*}{RT} \right) \\
	\therefore \; \dfrac{\sigma_s}{T} 
	&= \dfrac{1}{v^*} 
		\left[
			\dfrac{\Delta G}{T} 
			+ R \ln 
			\left(
			\dfrac{\dot{\epsilon}}{\dot{\epsilon}_0} 
			\right) 
		\right] \\
	&\propto \log \dot{\epsilon}
\end{align*}
